import React from 'react';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Button from 'react-bootstrap/Button';
import Badge from 'react-bootstrap/Badge';
import Navbar from '../navSection/Navbar';
import AccountBalanceIcon from '@mui/icons-material/AccountBalance';
import SearchBar from '../component/SearchBar';
import Masonry, { ResponsiveMasonry } from 'react-responsive-masonry';
import './profile.css';
import Footer from '../footerSection/Footer';
const Profile = () => {
  const data = [
    {
      contents: [
        { name: 'jollof rice', quantity: 2, category: 'food' },
        { name: 'fried chicken', quantity: 5, category: 'meat' },
        { name: 'bottle water', quantity: 1, category: 'water' },
        { name: 'okro and panded yam', quantity: 7, category: 'food' },
      ],
      img: '/images/ghanajolof.jpg',
    },
    {
      contents: [
        { name: 'jollof rice', quantity: 2, category: 'food' },
        { name: 'fried chicken', quantity: 5, category: 'meat' },
        { name: 'bottle water', quantity: 1, category: 'water' },
        { name: 'okro and panded yam', quantity: 7, category: 'food' },
      ],
      img: '/images/freshfoods.jpg',
    },
    {
      contents: [
        { name: 'jollof rice', quantity: 2, category: 'food' },
        { name: 'fried chicken', quantity: 5, category: 'meat' },
        { name: 'bottle water', quantity: 1, category: 'water' },
        { name: 'okro and panded yam', quantity: 7, category: 'food' },
      ],
      img: '/images/jolofffff.jpg',
    },
    {
      contents: [
        { name: 'jollof rice', quantity: 2, category: 'food' },
        { name: 'fried chicken', quantity: 5, category: 'meat' },
        { name: 'bottle water', quantity: 1, category: 'water' },
        { name: 'okro and panded yam', quantity: 7, category: 'food' },
      ],
      img: '/images/okroandfufu.jpeg',
    },
  ];

  return (
    <div>
      <Navbar />
      <Container className="">
        <Row className="balance-info my-2">
          <Col className="d-flex p-3 border   justify-content-between ">
            <div className="d-flex flex-column ">
              {' '}
              <div className="d-flex flex-column mb-2">
                {' '}
                Available balance:
                <strong> N76,030.00</strong>
              </div>
              {/* Link or button for Sales History */}
              <div>
                {' '}
                <Button
                  variant="success"
                  className="fw-bold d-flex align-items-center"
                >
                  <AccountBalanceIcon />
                  CashOut
                </Button>
              </div>
            </div>
            <div className="text-end">
              {' '}
              <Button variant="link text-success">Sales History</Button>
            </div>
          </Col>
        </Row>
        <SearchBar />
        <div className="my-3 ">
         <div className='text-center mb-3 border-bottom border-grey'> <strong className='text-success fw-bold '>New Orders<Badge pill bg='danger'>{data.length}</Badge></strong></div>
          <ResponsiveMasonry
            columnsCountBreakPoints={{ 350: 1, 750: 2, 900: 2 }}
          >
            <Masonry gutter="20px">
              {data.map((item, index) => (
                <div
                  key={index}
                  className="d-flex align-items-center imageCardParent   gap-2 "
                  style={{ position: 'relative' }}
                >
                  <div className="cardImage">
                    <img src={item.img} alt="" style={{objectFit:"cover", borderRadius:"10px 0px 0px 10px"}}/>
                  </div>
                  <div className="fw-bold d-flex gap-1 flex-wrap">
                    {item.contents.slice(0, 3).map((content, index) => (
                      <div key={index}>
                        {
                          <span>
                            {content.category === 'food'
                              ? `${content.quantity} plate of ${content.name}, `
                              : content.category === 'meat'
                              ? ` ${content.quantity} pieces of ${content.name}, `
                              : `${content.quantity} pieces of ${content.name}${
                                  item.contents.length > 3 ? '...' : ''
                                } `}
                          </span>
                        }
                      </div>
                    ))}
                  </div>
                  <div className='opacity-40'>
                    <img
                      src="https://wonderingfair.files.wordpress.com/2014/12/new-logo.gif"
                      alt=""
                      style={{
                        width: '40px',
                        height: '40px',
                        position: 'absolute',
                        top: 0,
                        right: 6,
                      }}
                    />
                  </div>
                </div>

              ))}
            </Masonry>
          </ResponsiveMasonry>
        </div>
      </Container>
      <Footer/>
    </div>
  );
};

export default Profile;
